import React from 'react'
import Navbar from './navbar'

class Header extends React.Component {
  constructor(props) {
    super(props)
  }
  componentDidMount() {
    window.addEventListener("mousemove", this.cursor)
  }
  cursor = (e) => {
    const cursor = document.querySelector('.custom-cursor-sword')
    cursor.style.transform = 'matrix(1, 0, 0, 1, '+ (e.pageX) +', '+ (e.pageY - window.scrollY) +')'
  }
  render() {
    return (
      <header id="header">
        <div className="header">
          <div className="container">
            <div className="row">
              <div className="col-2 text-left">
                <nav className="navbar">
                  <ul className="navbar-nav">
                    <li className="nonavstyle"><a href="/discord"><i className="fab fa-discord fa-lg"></i></a></li>
                    <li className="nonavstyle"><a href="/discord"><i className="fab fa-facebook-square fa-lg"></i></a></li>
                  </ul>
                </nav>
              </div>
              <div className="col-10">
                <Navbar />
              </div>
            </div>
          </div>
        </div>
      </header>
    )
  }
}
export default Header
